PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "schema_migrations" ("version" varchar NOT NULL PRIMARY KEY);
CREATE TABLE IF NOT EXISTS "ar_internal_metadata" ("key" varchar NOT NULL PRIMARY KEY, "value" varchar, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL);
CREATE TABLE IF NOT EXISTS "officials" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL, "party_affiliation" varchar, "state" varchar, "image_url" varchar);
CREATE TABLE IF NOT EXISTS "stocks" ("id" integer NOT NULL PRIMARY KEY, "name" varchar DEFAULT NULL, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL);
CREATE TABLE IF NOT EXISTS "users" ("id" integer NOT NULL PRIMARY KEY, "email" varchar DEFAULT '' NOT NULL, "encrypted_password" varchar DEFAULT '' NOT NULL, "reset_password_token" varchar DEFAULT NULL, "reset_password_sent_at" datetime(6) DEFAULT NULL, "remember_created_at" datetime(6) DEFAULT NULL, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL);
CREATE TABLE IF NOT EXISTS "trades" ("id" integer NOT NULL PRIMARY KEY, "official_id" integer NOT NULL, "stock_id" integer NOT NULL, "transaction_type" integer DEFAULT 0, "transaction_count" integer DEFAULT NULL, "security_type" varchar DEFAULT NULL, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL, CONSTRAINT "fk_rails_407c8a461a"
FOREIGN KEY ("official_id")
  REFERENCES "officials" ("id")
, CONSTRAINT "fk_rails_8a8aa453a2"
FOREIGN KEY ("stock_id")
  REFERENCES "stocks" ("id")
);
DELETE FROM sqlite_sequence;
CREATE UNIQUE INDEX "index_users_on_email" ON "users" ("email");
CREATE UNIQUE INDEX "index_users_on_reset_password_token" ON "users" ("reset_password_token");
CREATE INDEX "index_trades_on_official_id" ON "trades" ("official_id");
CREATE INDEX "index_trades_on_stock_id" ON "trades" ("stock_id");
COMMIT;
